const Dropdown = ({ submenus,dropdown }) => {
    console.log(submenus)

    return (
        <ul className={`dropdown ${dropdown ? "show" : ""}`}>
            {submenus.map((submenu, index) => (
                <li key={index} className="menu-items">
                    <p>Typ silnika: {submenu.silnik}</p>
                    <p>Moc: {submenu.moc}</p>
                    <p>Moment obrotowy: {submenu.moment}</p>
                    <p>Waga na sucho: {submenu.waga_na_sucho}</p>
                    <p>Pojemność zbiornika paliwa: {submenu.zbiornik}</p>
                </li>
            ))}
